import { get, post, put, deleted } from "../base/fetch";
import { usePaginate } from "../base/paginate";
import { Resident } from "./model";

export const create = async (resident: Resident) => {
  const res = await post<Resident>('/api/residents');
  return res;
};

export const update = async (resident: Resident) => {
  const res = await put<Resident>(`/api/residents/${resident.id}`, JSON.stringify(resident));
  return res;
};

export const destroy = async (id: number) => {
  const res = await deleted(`/api/residents/${id}`);
  return res;
};

export const getResidentsList = () => {
  return usePaginate<Resident>('/api/residents/')
};

export const getResident = async (id: number) => {
  const res = await get(`/api/residents/ + ${JSON.stringify(id)}`);
  return res;
};
